import React from 'react'

function LiquorCategory({props}) {

    const liquors = props.map( obj => (
        <div id='componliquor'>
        <main>
            <img src={obj.image} alt={obj.title} />
            <p style={{textAlign: "center"}}> 
                Rating : {obj.rating}/5 <br />
                {obj.title} <br />
                {obj.description}
                Ksh.{obj.price}
            </p>
        </main>
    </div>
    ))

  return (
    <div className='liquors'>
        {liquors}
    </div>
  )
}

export default LiquorCategory
